#include "starter_canvas.h"
#include <iostream>

void MyCanvas::clear(const GColor& color) {
    const GColor& newColor = premultiply(color);
    const GPixel& coloredPixel = scale(newColor);

    GBitmap bm = this->fDevice;
    for(int y = 0; y < bm.height(); y++) {
        for(int x = 0; x < bm.width(); x++) {
            GPixel* pixel = bm.getAddr(x, y);
            *pixel = coloredPixel;
        }
    }
}

void MyCanvas::fillRect(const GRect& rect, const GColor& color) {
    const GColor& premulSrc = premultiply(color);
    const GPixel& src = scale(premulSrc);

    const GIRect& r2 = intersect(rect.round(), this->fDevice.width(), this->fDevice.height());
    if(color.a == 1.0) { 
        for(int y = r2.top; y < r2.bottom; ++y) {
            for(int x = r2.left; x < r2.right; ++x) {
                GPixel* pixel = this->fDevice.getAddr(x, y);
                *pixel = src;
            }
        }
        return;
    }
    for(int y = r2.top; y < r2.bottom; ++y) {
        for(int x = r2.left; x < r2.right; ++x) {
            GPixel* pixel = this->fDevice.getAddr(x, y);
            *pixel = blend(src, *pixel);
        }
    }
}

const GPixel MyCanvas::blend(const GPixel& src, GPixel dst) {
    const int srcACmp = 255 - GPixel_GetA(src);
    const int a = GPixel_GetA(src) + GDiv255(srcACmp * GPixel_GetA(dst));
    const int r = GPixel_GetR(src) + GDiv255(srcACmp * GPixel_GetR(dst));
    const int g = GPixel_GetG(src) + GDiv255(srcACmp * GPixel_GetG(dst));
    const int b = GPixel_GetB(src) + GDiv255(srcACmp * GPixel_GetB(dst));
    return GPixel_PackARGB(a, r, g, b);
}

std::unique_ptr<GCanvas> GCreateCanvas(const GBitmap& device) {
    return std::unique_ptr<GCanvas>(new MyCanvas(device));
}

